import React, { Component } from "react";

class Form extends Component {
  state = { name: "", nameError: "", email: "", emailError: "" };

  render() {
    return (
      <div>
        <h1>Forma ideale</h1>
        <div>
          <label>name</label>
          <input type="text" />
        </div>
        <div>
          <label>mail</label>
          <input type="email" />
        </div>
        <div>
          <label>password</label>
          <input type="password" />
        </div>
        <div>
          <label>URL</label>
          <input type="url" />
        </div>
      </div>
    );
  }
}

export default Form;
